const ClearArrData = () => {
const CbioData = [
  {
id: 1, name: 'John', age: 30
  },
  {
    id: 2, name: 'Smith', age: 28

  },
  {
    id: 3, name: 'Henry', age: 26

  }

]

  return (
<>
{
CbioData.map((cEle) => {
   <h1>Customer ID: {cEle.id} & Customer Name: {cEle.name} & Customer Age: {cEle.age}</h1>
})
}

</>
  )

  }
